                        <p>Название товара: {item.name}</p>
                        <p>Стоимость товара: {item.price}</p>
                        <p>Кол-во товаров: {item.psc}</p>
                    </div>
                )
            })}
        </div> */}

        <table className={styles.table}>
            <thead>
                <tr>
                    <th>Название</th>
                    <th>Стоимость</th>
                    <th>Количество</th>
                </tr>
            </thead>
            <tbody>
                {data.map((item) => (
                    <tr key={item._id}>
                        <td>{item.name}</td>
                        <td>{item.price}</td>
                        <td>{item.psc}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    </main>
);
